import {useEffect} from "react";
import axiox from "axios";
export default function ListProduct(){
    function loadProduct(){
        axiox.get("http://localhost:9999/products").then(response => {
            console.log(response.data);
        })
    }
    useEffect(() => {
        loadProduct();
    }, [] )
    return (
        <>
            <h1>List Product</h1></>
    )
}
